export default `<div class="hz-b7210d09-b12e-4d0f-b39e-bb8cdea54bca" style="position: relative; width: 100%; height: 400px; background-color: rgb(0, 0, 0);"><div class="hz-833c5b02-bcfe-4503-994f-55324cff799a" style="position: absolute; width: 400px; height: 400px; left: 0%; top: 0%; transform: translate(0%, 0%);"><img id="4706e2ec-f798-4cc3-b274-796398f7dc00" src="data:image/jpeg;base64," style="width: 400px; height: 400px;"></div><span class="hz-972d88b2-8423-4880-904c-101f6366fdcb" style="position: absolute; width: 800px; height: 383.12px; left: 100%; top: 100%; transform: translate(-100%, -100%) rotate(0deg); color: rgb(255, 255, 255); font-size: 20px; line-height: 1.2; text-align: center; z-index: 10;">Then there's the surf. A pointbreak breaking for 300 meters down a shallow coral shelf, producing immaculate almond-shaped barrels, grinding down the reef at a barely makeable speed. Even though many of the waves race past me on my struggling backhand, the few that I make it to the end of are some of the best I've ever experienced, and I have a hard time containing my excitement, hooting and hollering to Sofia on the cliffs, with her Canon 5D in hand. The line-up out back is an eclectic mix of old salty men on oversized gun surfboards, young semi-pros with stickered boards, girlfriends on longboards and hippies with dreadlocks and big smiles. Nothing of the notorious localism I have read about online, even though I quickly learn to respect the noticeable pecking order, letting the obviously more skilled crowd get the biggest set waves. There are still plenty of action for everyone, and a friendly smile opens up even the grumpiest old-timer. After the sun has set, the same faces are seen around campfires and tailgate barbeques all over the campground, where many seem to have gotten stuck for the season, ignoring distant calls of civilization urging them to return to normal lives. As the stars come out, we set up our cameras for timelapses, hoping to capture some of the magic that is happening above us, all the while our heads turn heavy from the five hours in the water and the beverages that followed.</span></div>`